import crypto from 'cryptoJS'

const generateChecksum = (obj) => {
    const keys = Object.keys(obj)
    let str = ""
    keys.forEach(key => {
        str+=obj[key]
        str+="|"
    })
    return crypto.createHash('sha256').update(str).digest('hex')
}

export default generateChecksum
